%spark
import scala.collection.mutable.WrappedArray

def getInfoTitle(): (WrappedArray[String] => WrappedArray[String]) = { infoLst => 
	if (null == infoLst) {
		null
	} else {
		var tmp = ""
		val pa = "<.*?>|infobox|\\|(.*)|\\{|\\}|(<ref>.*?</ref>)".r
		val infoNames = infoLst.map( r => {
			val firstLine = r.split("\n", 2)(0).trim
			tmp = pa.replaceAllIn(firstLine.toLowerCase, " ")
			tmp.trim.replaceAll(" +", " ")
		})
		infoNames
	}
}

def getCateName(): (WrappedArray[String] => WrappedArray[String]) = { cateLst => 
	if (null == cateLst) {
		null
	} else {
		var tmp = ""
		val pa = "category|:|\\||\\[|\\]|(<ref>.*?</ref>)".r
		val cateNames = cateLst.map( r => {
			val firstLine = r.split("\n", 2)(0).trim
			tmp = pa.replaceAllIn(firstLine.toLowerCase, " ")
			tmp.trim.replaceAll(" +", " ")
		})
		cateNames
	}
}

import org.json4s._
import org.json4s.jackson.Serialization
import org.json4s.jackson.Serialization.write
import org.json4s.JsonDSL._
import org.json4s.jackson.JsonMethods._

def getTableCols(): (WrappedArray[String] => String) = { tabLst => 
	if (null == tabLst) {
		null 
	} else {
		val colPa = "\\{\\{.*?\\}\\}|!|<.*?>|''|\\[|\\]|\\}|(<ref>.*?</ref>)".r
		val colPa2 = "\\[\\[.*?\\]\\]".r
		val namePa = "\\{\\{(.*)\\}\\}|\\+|\\||(<ref>.*?</ref>)".r

		var wikiTables = tabLst.toList.map( r => {
			var colName = ""
			var tableName = ""

			val rawTableName = r.split("\n").filter(_.trim.startsWith("|+"))
			if (!rawTableName.isEmpty) {
				val rawName = rawTableName(0)
				tableName = namePa.replaceAllIn(rawName.toLowerCase, " ").replaceAll(" +", " ").trim
			}

			val rawColLst = r.split("\n").filter(_.trim.startsWith("!"))
			var realColLst = rawColLst 
			if (!rawColLst.isEmpty) {
				val firstEle = rawColLst(0)
				if (firstEle contains "!!") {
					realColLst = firstEle.split("!!")
				}
			}

			val tableCols = realColLst.toList.map(a => {
				if (a contains "[[") {
					colPa2.findFirstIn(a).getOrElse("").trim.stripPrefix("[[").stripSuffix("]]").trim.replaceAll(" +", " ").trim
				} else {
					colName = colPa.replaceAllIn(a.toLowerCase, " ")
					colName.trim.replaceAll(" +", " ").split("\\|").filter(x => !(x contains "=")).mkString(" ").trim
				}
			})
			Map("tableName" -> tableName, "tableCols" -> tableCols)
		})
		implicit val formats = DefaultFormats
		write(wikiTables)
	}
}

val extInfoMeta = udf(getInfoTitle)
val extCateMeta = udf(getCateName)
val extTableMeta = udf(getTableCols)

